import React from "react";
import ReactDOM from "react-dom";
import App from "./App";
import Hdata from "./DOH"

function Loop(val){
	return(
		<App 

	IS={val.IS}
	HN={val.HN}
	HP={val.HP}
	/>)
}

ReactDOM.render(
<>
{Hdata.map(Loop)}

</>
, document.getElementById('root'));
